sources.style/03-organisms/header.scss:
.o-header {
  background-color: var(--colorPrimary);
  padding: var(--spaceM) 0;
}

.o-header--chapter {
  display: flex;
  flex-direction: column;

  & > * + * {
    margin-top: var(--spaceM);
  }

  @include medium {
    flex-direction: row;
    align-items: flex-end;

    & > * + * {
      margin-left: var(--spaceM);
    }

    & > :last-child {
      margin-left: auto;
    }
  }
}

sources.style/03-organisms/footer.scss:
.o-footer {
  display: flex;
  align-items: center;
  background-color: var(--colorPrimary);
  padding: var(--spaceM);

  & > * + * {
    margin-left: var(--spaceS);
  }

  & > :last-child {
    margin-left: auto;
  }
}

sources.style/04-layouts/main.scss:
.l-main {
  display: grid;
  grid-template-columns: 1fr minmax(0, 1000px) 1fr;
  grid-template-rows: auto 1fr auto;
  grid-gap: var(--spaceL);
  height: 100%;

  &::before,
  &::after {
    content: '';
    background-color: var(--colorPrimary);
    grid-row: 1;
    width: calc(100% + var(--spaceL));
    z-index: -1;
  }

  &::before {
    grid-column: 1;
  }

  &::after {
    grid-column: 3;
    position: relative;
    left: calc(var(--spaceL) * -1);
  }

  & > header {
    grid-column: 2;
  }

  & > main {
    padding: var(--spaceL) 0;
    grid-column: 2;
    grid-row: 2;

    & > * + * {
      margin-top: var(--spaceXL);
    }
  }

  & > footer {
    grid-column: 1 / span 3;
    grid-row: 3;
  }
}
